import React from "react";
import CartContext from "../../Context/CartContext";
function Cart(){
    const { cart } =useContext(CartContext);

    {Object.keys(cart).map((key) => {
        return (
        <div key={key}>
        <h3>{cart[key].name}</h3>
        <p>{cart[key].quantity}</p>
        </div>
        );
    })}

};

export default  Cart;
